import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css';
import ConsentPage from './ConsentPage';  // Import the ConsentPage component

const HomePage = () => (
  <div>
    <h1>Welcome</h1>
    {/* Link to navigate to the ConsentPage */}
    <a href="/consent">Go to Consent Page</a>
  </div>
);

const DemographicPage = () => (
  <div>
    <h3>How old are you mf?
      Are you a dude?</h3>
    {/* Content of the other page */}
  </div>
);

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/consent" element={<ConsentPage />} />
            <Route path="/demographic" element={<DemographicPage />} />
          </Routes>
        </header>
      </div>
    </Router>
  );
}

export default App;
